import React from 'react';
import { Link } from 'react-router-dom';
import './App.css';

function Home() {
  return (
    <div className="container home-page home-background">
      <h1>Welcome to the Laptop Store</h1>
      <p>
        Discover the best laptops for work, school, and play.<br />
        Explore our collection of high-performance laptops tailored to your needs.
      </p>

      <Link to="/products">
        <button className="shop-button">Shop Now</button>
      </Link>

      <img
        src="pexels-photo-1105379.webp"
        alt="Laptop Showcase"
        className="home-banner"
      />
    </div>
  );
}

export default Home;
